import {
	Box, Spinner,
} from '@chakra-ui/react';
import React, {  } from 'react';
import { Hero } from '../components/Hero';
import { Container } from '../components/Container';
import { Main } from '../components/Main';
import { DarkModeSwitch } from '../components/DarkModeSwitch';
import { Footer } from '../components/Footer';
import BarChart from '../components/BarChart';
import SocialNodeGraph from '../components/SocialNodeGraph';
import {ENDPOINT} from '../config';
import FancyBarChart from '../components/FancyBarChart';
const socketIOClient = require('socket.io-client');


interface indexProps {
    endpoint: string
    salesresponse: any
    timeresponse: number
}

class App extends React.Component<{},indexProps> {
	socket = socketIOClient(ENDPOINT);
	render() {
		return (
			<Container>
				<Hero title="DEMO" />
				<Main>
					<Box width="100%">
                        <BarChart dataPipe="FromSalesData" yAxisName="Sales" socketConnection={this.socket}></BarChart>
					</Box>
					<Box>
						<SocialNodeGraph dataPipe="FromSocialNodeData"></SocialNodeGraph>
					</Box>
					{/* <Box> i hate this library i really do
                        <FancyBarChart data={salesresponse}></FancyBarChart>
                    </Box> */}
				</Main>
				<DarkModeSwitch></DarkModeSwitch>
				<Footer>Fancy Footer Information</Footer>
			</Container>
		);
	}
}
export default App
